import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const ManageGroup = () => {
    return (
        <div className="container text-center p-2">
            <div className="row">
                <div className="col">
                    <h2>Manage Group</h2>
                </div>
                <div className="col d-block">
                    some content
                </div>
            </div>
        </div>
    );
};

export default ManageGroup;
